　大型高輝度のLEDが搭載されたナンバー灯(ライセンスプレートライト)ユニットです。<br><br>車種専用設計ユニットなのでユニットアッセンブリで交換します。SMDタイプのLEDを採用により照射角が大幅に拡大しました。また、アルミヒートシンク内蔵により放熱対策が万全です。<br><br>球切れ警告灯キャンセラー回路内蔵　エンジン始動時などに発生するチラツキ防止回路内蔵　※車種によっては、球切れ警告灯が点灯する場合もございます。その際は別途キャンセラーを御使用ください。<br><br>※取付の際、一部加工が必要になる場合がございます。<BR><BR>車種によっては警告灯が点灯する場合があります。その際は別途ダミーロード等をご用意ください<BR><BR>対応車種 ： 2011- アウディ A1 (8X)<br><br>車検対応品<br><br>ランプ、レンズ | LED<tr><td colspan="2">
